// src/components/NetworkScanner.js
import React from 'react';
import './NetworkScanner.css';

function NetworkScanner() {
  return (
    <div className="scanner-container">
      <div className="scanner-card">
        <h2>Network Scanner</h2>
        <p>
          Our Network Scanner provides comprehensive scanning capabilities to identify active devices,
          open ports, and potential vulnerabilities within your network. It operates continuously to ensure
          your network remains secure around the clock.
        </p>
        <div className="scanner-video">
          <video controls poster="/network-scanner-placeholder.jpg">
            <source src="/network-scanner-demo.mp4" type="video/mp4" />
            Your browser does not support the video tag.
          </video>
        </div>
      </div>
    </div>
  );
}

export default NetworkScanner;
